const stripeTestPromise = loadStripe(PUBLIC_KEY)

export default function StripeContainer({x,y}) {
	return (
		<Elements stripe={stripeTestPromise}>
			<PaymentForm price={x} id1={y}/>
		</Elements>
	)
}
